from collections import Counter
def find_clumping_kmers(seq,k,l,t):
    clumping_kmers = set()
    for i in range(len(seq)-l+1):
        clump_seq = seq[i:i+l] 
        kmers = []
        for i in range(len(seq)-k+1):
            kmers.append(clump_seq[i:i+k])
#             print(kmers)
        kmers = Counter(kmers).most_common()
#         print(kmers)
        for kmer in kmers:
            if kmer[1] >= t:
                clumping_kmers.add(kmer[0])
#         print(clumping_kmers)
#     print(clumping_kmers)
    return clumping_kmers

